import s1 from "./s1.jpg";
import s2 from "./s2.jpg";
import s3 from "./s3.jpg";

function Img() {
    return (
        <div className="slide">
            <img src={s1} alt="s1" />
            <img src={s2} alt="s1" />
            <img src={s3} alt="s1" />

        </div>
    );

}

export default Img;
